data:
  description:
  - This object represents a file uploaded to Telegram Passport. Currently all Telegram
    Passport files are in JPEG format when decrypted and don't exceed 10MB.
  fields:
    file_id:
      description: Identifier for this file, which can be used to download or reuse
        the file
      required: true
      types:
      - String
    file_unique_id:
      description: Unique identifier for this file, which is supposed to be the same
        over time and for different bots. Can't be used to download or reuse the file.
      required: true
      types:
      - String
    file_size:
      description: File size in bytes
      required: true
      types:
      - Integer
    file_date:
      description: Unix time when the file was uploaded
      required: true
      types:
      - Integer
  kind: struct
dirty: false
file_name: passport_file.py
